import React, { Component } from "react";

class Videos extends Component {
  render() {
    const size = {
      height: "200px",
      width: "200px"
    };
    return (
      <div className="videos">
        <div className="videos__thumbnail">
          <img src={this.props.image} style={size} />
        </div>
        <div className="videos__details">
          {this.props.title} {this.props.channel}
        </div>
      </div>
    );
  }
}

export default Videos;
